import React from 'react';
import '../App.css';
import profile from '../JariExample.png';

const Todo = () => {


   return ( 
   <div className= 'frame3'>
      <h2 className= 'Port-header'>Things I am working on {"\n"}the Spring 2020</h2>
      <li className= 'Port-basic'> In the beginning of the year 2020, I am in the middle of
      course User Experience: Desing and Evaluation (UXDE). In the course we have a group project of three 
      where we design an application to users of shared vehicles. The task is very interesting since it 
      is a real case and deals with shared economy which is something I am very interested in. 
      Prototyping is still in the early phase and the whole project is still going on from our behalf. 
      But at this point we have made online questionnaire for the citizens of Tampere, piced up some attitudes and 
      ideas from them and read scientific literature reladted to sharing economy and our work generally. Based on the questionnaire and 
      Russel Belk's article "You are what you can access: Sharing and collaborative consumption online" (2014) I build one example user profile for us.
      The quote in the middle is translated from a questionnaire answer.</li>
      <img className= 'Port-profileImg' src={profile}/>
  </div>
  )
}

export default Todo
